import React from 'react';

const AuthContext = React.createContext({
  user: undefined,
  updateLoaded: undefined,
  authToken: undefined,
  onLogin: () => undefined,
  onLogout: () => undefined,
  updateLoaded: () => undefined,
});

export default AuthContext;
